PRAGMA defer_foreign_keys=TRUE;
CREATE TABLE categories (id INTEGER PRIMARY KEY AUTOINCREMENT, name TEXT NOT NULL, parentId INTEGER, createdAt TEXT NOT NULL, updatedAt TEXT NOT NULL, sortOrder INTEGER NOT NULL DEFAULT 0, FOREIGN KEY (parentId) REFERENCES categories(id));
CREATE TABLE products (id INTEGER PRIMARY KEY AUTOINCREMENT, sku TEXT UNIQUE, name TEXT NOT NULL, ean13 TEXT, price REAL DEFAULT 0, description TEXT, imageUrls TEXT, imageSize INTEGER DEFAULT 90, categoryId INTEGER, createdAt TEXT NOT NULL, updatedAt TEXT NOT NULL, FOREIGN KEY (categoryId) REFERENCES categories(id));
DELETE FROM sqlite_sequence;
